int pinLED = 10;                            // Mendeklarasikan pinLED pada pin no 10

void setup() {  
  pinMode(pinLED,OUTPUT);                   // Menginisiasi pin 10 sebagai OUTPUT

  Serial.begin(9600);                       // Mengaktifkan Serial
  Serial.println("Serial Telah Di Mulai");
}

void loop() {
  digitalWrite(pinLED,HIGH);   // Memberi tegangan (+) di pin 10 / menyalakan LED
  delay(1000);                 // Menunggu 1 detik
  digitalWrite(pinLED,LOW);    // Tidak memberi tegangan di pin 10 / mematikan LED
  delay(1000);                 // Menunggu 1 detik
}

