using namespace std;

int main() {
    string agency;
    getline(cin, agency);

    int ticket, kidTicket;
    cin >> ticket >> kidTicket;

    double ticketPrice, service;
    cin >> ticketPrice >> service;

    double totalAdult = (ticketPrice + service) * ticket;
    double totalKid = (0.3 * ticketPrice + service) * kidTicket;
    double total = (totalAdult + totalKid) / 5;

    printf("The profit of your agency from %s tickets is %.2f lv.", agency.c_str(), total);

    return 0;
}

#include <iostream>

using namespace std;

int main() {
    double priceOver20kg, bagWeight;
    cin >> priceOver20kg >> bagWeight;

    int dayBefore, bagCount;
    cin >> dayBefore >> bagCount;

    if (bagWeight < 10) {
        priceOver20kg /= 5;
    }
    else if (bagWeight <= 20) {
        priceOver20kg /= 2;
    }

    if (dayBefore < 7) {
        priceOver20kg *= 1.4;
    }
    else if (dayBefore <= 30) {
        priceOver20kg *= 1.15;
    }
    else if (dayBefore > 30){
        priceOver20kg *= 1.1;
    }

    double total = priceOver20kg * bagCount;

    printf("The total price of bags is: %.2f lv.\n", total);

    return 0;
}

