void fiveInOne(ll n)
{
    ll arr[n] = {0};
    for (int i = 0; i < n; i++)
    {
        cin >> arr[i];
    }
    ll mx = 0;
    ll mn = mod;
    ll numOfPrimes = 0;
    ll numOfPalindrome = 0;
    ll res = 0;
    ll idx = 0;

    for (int i = 0; i < n; i++)
    {
        // Get the maximum number
        if (arr[i] > mx)
        {
            mx = arr[i];
        }
        // Get the minimum number
        if (arr[i] < mn)
        {
            mn = arr[i];
        }
        // Check how many prime numbers
        bool isPrime = true;
        if (arr[i] != 1)
        {
            for (int j = 2; j < sqrt(arr[i]); j++)
            {
                if (arr[i] % j == 0 && arr[i] != 2)
                {
                    isPrime = false;
                    break;
                }
            }
            if (isPrime)
            {
                numOfPrimes++;
            }
        }
        // Ckeck how many palindrome
        string str = to_string(arr[i]);
        string rev = str;
        reverse(rev.begin(), rev.end());
        if (str == rev)
        {
            numOfPalindrome++;
        }
        // Check the number that has the maximum number of divisors
        int divisors = 0;
        for (int j = 1; j <= arr[i]; j++)
        {

            if (arr[i] % j == 0)
            {
                divisors++;
            }
        }
        // 1 14 4 8
        // 14 => 1 2 7 14
        // 8 => 1 2 4 8
        if (divisors > res)
        {
            res = divisors;
            idx = arr[i];
        }
        if (divisors == res)
        {
            idx = max(arr[i], idx);
        }
    }
    cout << "The maximum number : " << mx << nl;
    cout << "The minimum number : " << mn << nl;
    cout << "The number of prime numbers : " << numOfPrimes << nl;
    cout << "The number of palindrome numbers : " << numOfPalindrome << nl;
    cout << "The number that has the maximum number of divisors : " << idx << nl;
    /*

    */
}
int main()
{
    Devzak();
    ll n;
    cin >> n;
    fiveInOne(n);
    return 0;
}

@echo off
setlocal enabledelayedexpansion

rem MoveToTree.bat v1.0.1.
rem
rem Move files in current directory into directory tree according to "tree.txt" file which was made using "tree /a /f" command.
rem
rem Context: https://old.reddit.com/r/CodingHelp/comments/16h94fs/how_to_sort_all_files_in_accordance_with_treetxt/
rem
rem Usage:
rem
rem   For testing purpose. Simulate moving files to tree. Does not actually move the files, but it does check for files presence.
rem     MoveToTree.bat
rem
rem   Actually move files into directory tree.
rem     MoveToTree.bat doit
rem
rem Files which need to be moved into tree along with the "tree.txt" file, must be in the current directory.
rem Script will create all tree subdirectories as needed.
rem Script will terminate if "tree.txt" file format is invalid or is not in English language.
rem Script will terminate if any line in "tree.txt" is unrecognized.
rem Script will terminate if it can not create needed subdirectory or can not move needed file.
rem Script will report any missing file, but will not terminate the script if a file is missing.

if "%~1" == "doit" (
  set doit=1
) else set doit=0

if not exist tree.txt (
  echo "tree.txt" file is not found.
  goto :eof
)

set dirLevels=-1
set ln=1
for /f "delims=" %%A in (tree.txt) do (
  set "l=%%A"
  if !ln! == 1 (
    if "!l:~0,19!" neq "Folder PATH listing" (
      echo Invalid tree file.
      goto :eof
    )
  ) else if !ln! gtr 3 (
    if "!l:~-1!" neq "|" (
      call :processLine
      if errorlevel 1 goto :eof
    )
  )
  set /a ln+=1
)
goto :eof

:processLine
set type=file
set lv=0
:chklvl
set /a i=lv*4
set "c=!l:~%i%,1!"
if "%c%" == " " (
  set /a lv+=1
  goto chklvl
)
if "%c%" == "|" (
  set type=file
  set /a lv+=1
  goto :chklvl
) else if "%c%" == "\" (
  set type=dir
  set /a lv+=1
  goto :chklvl
) else if "%c%" == "+" (
  set type=dir
  set /a lv+=1
  goto :chklvl
) else if "%type%" == "" (
  echo ERROR: Unrecognized line at line %ln%.
  exit /b 1
)
set "name=!l:~%i%!"
if "%name%" neq "" (
  set /a lv-=1
) else (
  set type=ignore
  goto :eof
)
if "%type%" == "dir" (
  set dirLevels=%lv%
  set "dir%lv%=%name%"
)
set dir=
for /l %%B in (0,1,%dirLevels%) do set "dir=!dir!!dir%%B!\"
if "%type%" == "file" goto file

:dir
echo "%dir%"
if %doit% == 1 (
  if not exist "%dir%" (
    md "%dir%"
    if errorlevel 1 exit /b 1
  )
)
goto :eof

:file
echo "%dir%%name%"
if exist "%name%" (
  if %doit% == 1 (
    >nul move "%name%" "%dir%"
    if errorlevel 1 exit /b 1
  )
) else echo ERROR: File "%name%" is not found.
goto :eof

import sqlite3


class Database:
    def __init__(self, db_file):
        self.conn = sqlite3.connect(db_file)
        self.cursor = self.conn.cursor()

        CREATE_TABLE_COMMAND = """CREATE TABLE IF NOT EXISTS users (id BIGINT PRIMARY KEY, user_id INT, user_name TEXT, money INT)"""
        self.cursor.execute(CREATE_TABLE_COMMAND)

    def user_exists(self, user_id):
        self.cursor.execute("SELECT 1 FROM users WHERE user_id=?", (user_id,))
        return None if self.cursor.fetchone() is None else True

    def add_user(self, user_id, user_name):
        if not self.user_exists(user_id):
            with self.conn:
                self.cursor.execute("INSERT INTO 'users' ('user_id', 'user_name') VALUES (?,?)", (user_id, user_name,))
                self.conn.commit()
        else:
            print('user already exists')
        
    def set_user_money(self, user_id, money):
        self.cursor.execute("UPDATE users SET money=? WHERE user_id=?", (money, user_id,))
        self.conn.commit()

    def get_user_money(self, user_id):
        self.cursor.execute("SELECT money FROM users WHERE user_id=?", (user_id,))
        return self.cursor.fetchone()[0]

