class Solution {
public:
    vector<vector<int>> threeSum(vector<int>& nums) {
        
        vector<vector<int>> Triplets;

        sort(nums.begin(), nums.end());

        if(nums.front() > 0 || nums.back() < 0 ){return Triplets;}


        //  nums.size() - 2 <-- "3 <= nums.length <= 3000"
        for(int i = 0; i < nums.size() - 2; ++i){ 

            if(i > 0 && nums[i - 1] == nums[i]){ //    nums[i]  ,      ,          nums[i - 1]
                continue;
            }
            if (nums[i] + nums[nums.size() - 1] + nums[nums.size() - 2] < 0) {continue;}
            if (nums[i] + nums[i + 1] + nums[i + 2] > 0) {return Triplets;}

            for(int j = i + 1; j < nums.size() - 1; ++j){
               
                const int Target = nums[i] + nums[j];
                if(Target > 0){break;}
                
                int k = nums.size() - 1;
                for(; j + 1 != k && Target + nums[k] > 0; --k); // j + 1 != k // !
                if(Target + nums[k] == 0/* &&(Triplets.empty() || Triplets.back() != vector<int>{nums[i], nums[j], nums[k]})*/){
                    //cout << "push_back " << i  << ' ' << j << ' '<< k  << '\n';
                    Triplets.push_back({nums[i], nums[j], nums[k]});
                }
                
                while(j + 1 < nums.size() - 1 && nums[j] == nums[j + 1]){++j;}
                //while(j + 1 != k && nums[k-1] == nums[k]){--k;}
            }

        }


        return Triplets;
    }
};

